DROP TABLE IF EXISTS `employment`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `employment` (
  `id` int NOT NULL,
  `job_id` varchar(3) COLLATE utf8mb4_general_ci NOT NULL,
  `pay_grade` tinyint NOT NULL,
  `stat_id` varchar(1) COLLATE utf8mb4_general_ci NOT NULL,
  `dept_id` varchar(5) COLLATE utf8mb4_general_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `stat_id` (`stat_id`),
  KEY `job_id` (`job_id`),
  KEY `pay_grade` (`pay_grade`),
  KEY `dept_id` (`dept_id`),
  CONSTRAINT `employment_ibfk_1` FOREIGN KEY (`id`) REFERENCES `employee` (`id`),
  CONSTRAINT `employment_ibfk_2` FOREIGN KEY (`stat_id`) REFERENCES `emp_status` (`stat_id`),
  CONSTRAINT `employment_ibfk_3` FOREIGN KEY (`job_id`) REFERENCES `job` (`job_id`),
  CONSTRAINT `employment_ibfk_4` FOREIGN KEY (`pay_grade`) REFERENCES `pay_level` (`pay_grade`),
  CONSTRAINT `employment_ibfk_5` FOREIGN KEY (`dept_id`) REFERENCES `department` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

